import React, { useEffect, useState } from 'react';
import { getInvestmentData } from './googleSheetService';

function InvestmentDashboard() {
  const [data, setData] = useState({
    currentValue: '-',
    totalReturns: '-',
    returnsPercent: '-',
    invested: '-',
    xirr: '-',
    dayReturn: '-',
    dayReturnPercent: '-',
  });

  useEffect(() => {
    getInvestmentData().then(setData);
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-b from-purple-700 to-purple-500 text-white font-sans">
      <header className="flex items-center justify-between px-5 py-4">
        <div className="flex items-center space-x-2">
          <img src="/assets/1fi-logo.png" alt="1Fi Logo" className="w-6 h-6" />
          <span className="font-semibold text-lg">Invest</span>
        </div>
        <button className="text-white text-2xl">ðŸ””</button>
      </header>

      <main className="px-6">
        <p className="text-center text-lg font-medium">Current Value</p>
        <h1 className="text-center text-4xl font-bold mt-1">
          â‚¹ {data.currentValue}
        </h1>
        <p className="text-center text-sm mt-1 text-green-300">
          Total Returns â†‘ â‚¹ {data.totalReturns} ({data.returnsPercent})
        </p>

        <div className="flex justify-between mt-6 gap-2">
          <InfoCard label="Invested" value={`â‚¹ ${data.invested}`} />
          <InfoCard label="XIRR" value={data.xirr} />
          <InfoCard label="1 Day Return" value={`â‚¹ ${data.dayReturn} (${data.dayReturnPercent})`} />
        </div>

        <ChartPlaceholder />

        <div className="mt-6">
          <button className="w-full bg-green-500 py-3 rounded-xl font-semibold text-white shadow-lg">
            + Invest more
          </button>
        </div>

        <div className="mt-4">
          <button className="w-full bg-purple-900 py-3 rounded-xl text-white font-medium shadow-md">
            ðŸŽ´ Get loan against your investments
          </button>
        </div>

        <div className="flex justify-around mt-6">
          <NavButton label="Portfolio" />
          <NavButton label="Redeem" />
          <NavButton label="Transactions" />
        </div>
      </main>

      <footer className="fixed bottom-0 w-full bg-white text-purple-700 flex justify-around py-2 shadow-inner">
        <FooterIcon label="Home" />
        <FooterIcon label="Invest" active />
        <FooterIcon label="Loans" />
        <FooterIcon label="Profile" />
      </footer>
    </div>
  );
}

function InfoCard({ label, value }) {
  return (
    <div className="bg-purple-600 flex-1 text-center py-3 rounded-xl shadow-md">
      <p className="text-xs">{label}</p>
      <p className="text-sm font-semibold mt-1">{value}</p>
    </div>
  );
}

function NavButton({ label }) {
  return (
    <button className="text-sm border border-purple-200 px-4 py-2 rounded-lg bg-white text-purple-700 font-semibold">
      {label}
    </button>
  );
}

function FooterIcon({ label, active }) {
  return (
    <div className={`flex flex-col items-center text-xs ${active ? 'text-purple-700 font-bold' : 'text-gray-400'}`}>
      <span className="text-lg">â¬¤</span>
      {label}
    </div>
  );
}

function ChartPlaceholder() {
  return (
    <div className="bg-white rounded-2xl mt-6 p-4">
      <div className="h-32 flex items-center justify-center text-gray-400">[Chart Placeholder]</div>
      <div className="flex justify-around text-xs text-gray-600 mt-2">
        <span>1D</span><span>1W</span><span>3M</span><span>6M</span><span>1Y</span><span>5Y</span><span className="text-green-600 font-semibold">All</span>
      </div>
    </div>
  );
}

export default InvestmentDashboard;
